    const navigate = useNavigate()

    const onButtonClick = () => {
        //update function
    }

    return (
        <div className={'mainContainer'}>

            <div className={'titleContainer'}>
                <div>Login</div>
            </div>
            <br />

            <div className={'inputContainer'}>
                <input
                    value={email}
                    placeholder='Enter your email here'
                    onChange={(ev) => setEmail(ev.target.value)}
                    className={'inputBox'}
                />
